(Единственность продолжения) Пусть $\PP$~---~полукольцо подмножеств множества $X$. Пусть $\mu$ --- счетно-аддитивная мера на $\PP$. Пусть $\mu^*$~---~продолжение $\mu$ на $\sigma$-алгебру $\MM_{\mu^*}$, $\PP \subset \MM_{\mu^*}$, а $
u$ --- продолжение $\mu$ на какую-то другую $\sigma$-алгебру $\MM_{
u}$, $\PP \subset \MM_{
u}$. Тогда верно следующее:  egin{enumerate} \item $
u(A) \leq \mu^*(A)~~ orall A \in \MM_{\mu^*} \cap \MM_{
u}$. Если $\mu^*(A) < +\infty$, то $\mu^*(A) = 
u(A)$. \item Если $\mu$ --- $\sigma$-конечна, то $\mu^*(A) = 
u(A)~~ orall A \in \MM_{\mu^*} \cap \MM_{
u}$. \end{enumerate}

Пусть $\mu$ --- счетно-аддитивная $\sigma$-конечная мера на полукольце $\PP$ подмножеств множества $ X$. Пусть $
u$ --- полная мера на $\sigma$-алгебре $\MM_{
u}$, являющаяся продолжением $\mu$. Тогда $\MM_{\mu^*} \subset \MM_{
u}$.
